body:
An event of stream id "ncAlertOutputStream" will be send three times given below spec:

process.network.alerts: [
{
topicName: "network_aggregate_alert_output_datasource",
streamId: "ncAlertOutputStream",
groupingStrategies: [
{
partition: {
streamId: "ncAlertOutputStream",
type: "GROUPBY",
columns: [
"entity"
]
},
numTotalParticipatingRouterBolts: 4,
startSequence: 0,
totalTargetBoltIds: [
"streamRouterBolt0",
"streamRouterBolt1",
"streamRouterBolt2",
"streamRouterBolt3"
]
}
]
},
{
topicName: "network_aggregate_alert_output_datasource",
streamId: "sherlockAlertOutputStream",
groupingStrategies: [
{
partition: {
streamId: "sherlockAlertOutputStream",
type: "GROUPBY",
columns: [
"entity"
]
},
numTotalParticipatingRouterBolts: 4,
startSequence: 0,
totalTargetBoltIds: [
"streamRouterBolt0",
"streamRouterBolt1",
"streamRouterBolt2",
"streamRouterBolt3"
]
}
]
},
{
topicName: "network_aggregate_alert_output_datasource",
streamId: "correlatedAlertStream",
groupingStrategies: [
{
partition: {
streamId: "correlatedAlertStream",
type: "GROUPBY",
columns: [
"linkedSwitch"
]
},
numTotalParticipatingRouterBolts: 4,
startSequence: 0,
totalTargetBoltIds: [
"streamRouterBolt0",
"streamRouterBolt1",
"streamRouterBolt2",
"streamRouterBolt3"
]
}
]
}
],

The root cause is in SpoutOutputCollectorWrapper.emit() the streamId of group strategy is not compared with the given stream event.

Author: ralphsu

